import React from "react";

const FileUpload = () => {
  return (
    <div>
      <input type="file" name="file" onChange={ChangeHandler} />
      <div>
        <button onClick={handleSubmit}>Sumbit</button>
      </div>
    </div>
  );
};

export default FileUpload;
